    chromedriver = "D:/python/chromedriver_win32/chromedriver"
    os.environ["webdriver.chrome.driver"] = chromedriver
    browser = webdriver.Chrome(chromedriver)
    browser.get(url)

    src_updated = browser.page_source
    src = ""
    while src != src_updated:
        time.sleep(1)
        src = src_updated
        browser.execute_script("window.scrollTo(0, document.body.scrollHeight);")
        src_updated = browser.page_source

    html_source = browser.page_source
    
    
    browser.close()
    soup = BeautifulSoup(html_source)
    table=soup.find("table")
    #print (table)
    details={'Name':'null','University':'null','Program':'null','GRE Quant':0,'GRE Verb':0, 'GRE AWA':0, 'Toefl':0,'Undergrad':'null','Undergrad dept':'null','Grade':'null','Publications':0,'Work ex':0,'Year':'null'}
    t=table.find_all("td")
    for i in t:
        if(i.text=="Real Name"):
            details['Name']=i.findNext("td").text.strip(" ").strip('\n').strip('\t').strip(" ").encode('utf-8')
        if(i.text=="University (will be) Attending"):
            details['University']=i.findNext("td").text.strip(" ").strip('\n').encode('utf-8')
